import React from 'react';
import {Link} from 'react-router-dom'
import './homeCss.css'

const Menu = () => {


    return(
            <ul className="menu__navbar">
                <Link to='/home' className="menu__navbar-item text-dark"><i class="fa fa-home mr-2"></i>Доски </Link>
                <Link to='/todo' className="menu__navbar-item"><i class="fa fa-pager"></i>Главная страница</Link>
                <Link to='/aboutUs' className="menu__navbar-item"><i class="fa fa-building"></i>О нас</Link>
            </ul>
    )
}
export default Menu;
